import { GraphQLServer } from "graphql-yoga";
import resolvers from "./graphql/resolvers";
import http from "http";
import express from "express";
import path from "path";
import serve_static from "serve-static";


var app = express();
const PORT = 3000;

app.use(serve_static(path.join(__dirname, 'public/Hackathon-JustCorona-master/')));
app.set('port', process.env.PORT || PORT);

app.get('/', function(req, res){
	res.redirect('index.html');
});

http.createServer(app).listen(app.get('port'), function(){
	console.log("Server START ..." + app.get('port'));
	console.log("여기로 웹 페이지 접속 가능!! http://hackathon-justcorona-qumsh.run.goorm.io/");

	const server = new GraphQLServer({
		typeDefs: "graphql/schema.graphql",
		resolvers
	});

	server.start(() => console.log("Graphql Server Running on localhost:4000"));
});

