		id: 0,
		name: "Heongilee",
		gender: "male"
	},
	{
		id: 1,
		name: "YoungHyunKim",
		gender: "male"
	},
	{
		id: 2,
		name: "JaeungJeong",
		gender: "male"
	},
];

export const getPerson = () => People;
